    x = 1;

    function inner() {
        y = "Hello";
        return y;
    }

    return inner();
}

result1 = outer();

```



**Questions**:
1. What are the module-level function calls in the file 'main.js'?
2. What are the function calls inside the 'main.outer' function in the file 'main.js'?
